import React from "react";
import styled from "styled-components";
import Image from "../../login/image";
import { ContentWrapper, FlexContainer, CustomButton, ContentContainer, HeaderContainer, CenteredForm, FormContainer, Avatar, NavLink, Title, SubTitle } from "../../login/elements";
import colors from "../.././../theme/main/colors";
import Link from "next/link";

const LinkWithLine = styled("a")`
color:${colors.primary};
padding-left:5px;

}
`;

const CustomSubTitle = styled(SubTitle)`

padding-right:0px;

}
`;

const Signup = () => {
  return (
    <>
      <ContentWrapper>
        <Image type="driver" />
        <FormContainer>
          <CenteredForm>
            <HeaderContainer>
              <Title>Company Sign up</Title>
              <FlexContainer>
                <CustomSubTitle>Already have an account?</CustomSubTitle>
                <LinkWithLine href="/">Sign in</LinkWithLine>
              </FlexContainer>
            </HeaderContainer>
            <ContentContainer>

              <FlexContainer>
                <InputContainer>
                  <DefaultInput
                    label="First Name *"
                    placeholder="John"
                    id="firstname" />
                </InputContainer>

                <InputContainer>
                  <DefaultInput
                    label="First Name *"
                    placeholder="John"
                    id="firstname" />
                </InputContainer>
              </FlexContainer>

              <FlexContainer>

              </FlexContainer>
              <Link href="/login/verification">
                <CustomButton>Continue</CustomButton>
              </Link>
              <FlexContainer>
                <CustomSubTitle>Need help?</CustomSubTitle>
                <LinkWithLine href="/">Click here</LinkWithLine>

              </FlexContainer>
            </ContentContainer>
          </CenteredForm>
        </FormContainer>
      </ContentWrapper>
    </>
  );
};

export default Signup;
